import React from 'react';
import { Link as RouterLink } from 'react-router-dom';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Container,
} from '@mui/material';
import ExploreIcon from '@mui/icons-material/Explore';

function Navigation() {
  return (
    <AppBar position="static">
      <Container maxWidth="xl">
        <Toolbar>
          <ExploreIcon sx={{ mr: 2 }} />
          <Typography
            variant="h6"
            noWrap
            component={RouterLink}
            to="/"
            sx={{
              mr: 2,
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
              flexGrow: 1,
            }}
          >
            MEDIEKOMPASSET
          </Typography>

          <Button
            component={RouterLink}
            to="/"
            color="inherit"
          >
            Dashboard
          </Button>

          <Button
            component={RouterLink}
            to="/analyse"
            color="inherit"
          >
            Analyse
          </Button>

          <Button
            component={RouterLink}
            to="/metode"
            color="inherit"
          >
            Metode
          </Button>
        </Toolbar>
      </Container>
    </AppBar>
  );
}

export default Navigation;
